import {getSellerDetails} from '../../service/SellerAccountService'
export default{
    name:"SellerAccountComponent",
    data()
    {
    return{
        sellerDetail:[],
        editButton:false,
        seller: {
            name: '',
            emailId: '',
            contact: '',
            address: '',
            password: ''

        },
    }
    },
    mounted()
    {
        getSellerDetails({
            success: ({ data }) => {
                console.log(data)

                this.sellerDetail=data.data

            },
            error: (e) => {

                console.warn(e);
            }
        })
    }
}
